function extractJsonFromString(str) {
  //  remove all \n and \t from the string
  let json = str.replace(/(\n)/gm, "");

  json = replaceWords(json);

  //  remove all the text before the first { and after the last }
  const i = json.indexOf("{");
  const j = json.indexOf("}");

  json = json.substring(i, j + 1);

  // json = helper(json);

  console.log(">>>>>>", json);

  try {
    return JSON.parse(json);
  } catch (error) {
    return JSON.parse(helper(json));
  }
}

function replaceWords(str) {
  try {
    // Quality Issue -> quality issue
    // Quantity Issue -> quantity issue
    // Taste Issue -> taste issue
    // Packaging Issue -> packaging issue
    // Delivery & Timing Issue -> delivery timing issue
    // Price Issue -> price issue
    // Cooking Issue -> cooking issue
    // Freshness Issue -> freshness issue
    // Stalenes Issue -> stalenes issue
    // Hardness Issue -> hardness issue
    // Spice Issue -> spice issue
    // Temperature Issue -> temperature issue
    // Wrong Food Issue -> wrong food issue
    // Hygiene Issue -> hygiene issue
    // Missing Food Issue -> missing food issue
    // Oiliness Issue -> oiliness issue
    // Out of Stock Issue -> out of stock issue
    // Foreign Object Issue -> foreign object issue
    let finalStr = str.replace(/Quality Issue/g, "quality_issue");
    finalStr = finalStr.replace(/Quantity Issue/g, "quantity_issue");
    finalStr = finalStr.replace(/Taste Issue/g, "taste_issue");
    finalStr = finalStr.replace(/Packaging Issue/g, "packaging_issue");
    finalStr = finalStr.replace(
      /Delivery & Timing Issue/g,
      "delivery timing_issue"
    );
    finalStr = finalStr.replace(/Price Issue/g, "price_issue");
    finalStr = finalStr.replace(/Cooking Issue/g, "cooking_issue");
    finalStr = finalStr.replace(/Freshness Issue/g, "freshness_issue");
    finalStr = finalStr.replace(/Stalenes Issue/g, "stalenes_issue");
    finalStr = finalStr.replace(/Hardness Issue/g, "hardness_issue");
    finalStr = finalStr.replace(/Spice Issue/g, "spice_issue");
    finalStr = finalStr.replace(/Temperature Issue/g, "temperature_issue");
    finalStr = finalStr.replace(/Wrong Food Issue/g, "wrong_food_issue");
    finalStr = finalStr.replace(/Hygiene Issue/g, "hygiene_issue");
    finalStr = finalStr.replace(/Missing Food Issue/g, "missing food_issue");
    finalStr = finalStr.replace(/Oiliness Issue/g, "oiliness_issue");
    finalStr = finalStr.replace(/Out of Stock Issue/g, "out of stock_issue");
    finalStr = finalStr.replace(
      /Foreign Object Issue/g,
      "foreign_object_issue"
    );

    return finalStr;
  } catch (error) {
    return error;
  }
}

function helper(str) {
  str = str.replaceAll("{", '{"');
  str = str.replaceAll(":", '":');
  str = str.replaceAll(",", ',"');
  str = str.replaceAll(" ", "");
  return str;
}

